import React from "react";import Services from "../page/Services";
import ContactForm from "../page/ContactForm";
import About from "../page/About";
import CybersecurityStats from "../page/CybersecurityStats";
import Partners from "../page/Partners";
import firestore from "../page/FirebaseConfig"; // Make sure to import firestore from FirebaseConfig

function PaginaPrincipal() {
  return (
    <div>
      <Services />
      <ContactForm firestore={firestore} />
      <About />
      <CybersecurityStats />
      <Partners />
    </div>
  );
}

export default PaginaPrincipal;
